import "./header.css";

const Header = () => {
  return (
    <>
      <div className="header-wrapper">
        <div className="header-row">
          <img
            src="https://uploads-ssl.webflow.com/5ed0f381d2b21c219f260b60/5ee31dc8601c7f4fb62cb4c1_n17r-logo-red.png"
            loading="lazy"
            width="82"
            height="82"
            srcset="https://uploads-ssl.webflow.com/5ed0f381d2b21c219f260b60/5ee31dc8601c7f4fb62cb4c1_n17r-logo-red-p-500.png 500w, https://uploads-ssl.webflow.com/5ed0f381d2b21c219f260b60/5ee31dc8601c7f4fb62cb4c1_n17r-logo-red-p-800.png 800w, https://uploads-ssl.webflow.com/5ed0f381d2b21c219f260b60/5ee31dc8601c7f4fb62cb4c1_n17r-logo-red-p-1080.png 1080w, https://uploads-ssl.webflow.com/5ed0f381d2b21c219f260b60/5ee31dc8601c7f4fb62cb4c1_n17r-logo-red.png 1136w"
            sizes="(max-width: 479px) 35vw, 100px"
            alt=""
            class="image-19"
          />
        </div>
      </div>
    </>
  );
};

export default Header;
